import React, { Component } from 'react';
import './../../App.css';



///////







///////////
class Menu extends Component {
  
   // console.log(this.props.history.match.params.id);
 
  render() 
  
  {
    return (
     
       
        <div class="col-md-6" id="table-list">
        <div class="row list-filter">
            <div class="col-md list-filter-content">
               
                            <button class="btn btn-primary"></button>

                   
            </div>
        </div>
        <div class="row table-list">
            <div class="col-md table-list-content">
                <ul>
                   
                            <li class="tb-active" onclick="cms_load_pos()"></li>
                    
                </ul>
            </div>
        </div>
    </div>

    );
  }
}

export default Menu;
